import "./Header.css";
import { Link } from "react-router-dom";

function Header() {
  return (
    <header className="header-container">
      <nav className="header-nav sb">
        <div className="sb">
          <Link to="/posts" className="mr-24">
            Post
          </Link>
          <Link to="/about">About</Link>
        </div>
      </nav>
    </header>
  );
}

export default Header;
